import PropTypes from 'prop-types'

const Header = ({title}) => {
    return (
        <header>
            <h1>{title}</h1>
        </header>
    )
}

Header.defaulProps = {
    title: 'Task Tracker',
}

Header.PropTypes = {
    title: PropTypes.string,
}
export default Header
